import React, { Component } from "react";

class Table extends Component {
  render() {
    return (
      <table className="table">
        <thead>
            <th >#</th>
            <th >Name</th>
            <th >Price</th>
        </thead>
        <tbody>
          <tr>
            <th>1</th>
            <td>Mark</td>
            <td>Otto</td>
          </tr>
        </tbody>
      </table>
    );
  }
}

export default Table;
